import React from "react";
import "./App.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";

import Login from "./components/loginForm/login";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={Login} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
